import React from 'react';

const ImageSlide = ({ url, title, cinema, date  }) => {
  const styles = {
    backgroundImage: `url(${url})`,
    backgroundSize: 'cover',
    backgroundPosition: 'center'
  };

  return (
    <div 
    className="image-slide" 
    style={styles}
    title={title}
 	cinema={cinema}
 	date={date}   
>{title}
 	    </div>
  );
}

export default ImageSlide;
